syntax = "proto3";
package fanxi;
import "UserDetail.proto";
import "RestfulBaseResponse.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "RegisterResponseProto";

message RegisterResponse {
   RestfulBaseResponse baseResponse=1;
   UserDetail user= 2;
   string server = 3;
   bool isForceUpdate=4;
   string urlDownload=5;
}




